import "./App.css";
import MenuNav from "./components/landing/MenuNav";
// import Main from "./components/landing/Main";
// import LaMarque from "./components/landing/LaMarque";
// import LaCollection from "./components/landing/LaCollection";
import Acordeon from "./components/landing/Acordeon";

function App() {
  return (
    <>
      <div className="container-fluid principal">
        <div className="row">
          <div className=" col-lg-2  col-md-3 col-sm4- contenedor">
            <MenuNav />
          </div>
          <div className="col-lg-10 col-md-9 col-sm-8 contenedor">
            <Main />
            <LaMarque />
            <LaCollection />
            <Acordeon />
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
